import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'


class EmployeeComponent extends React.Component{
  constructor(props){
    super(props);

    this.state = {
      employees: []
    };
  };
  componentDidMount(){
    fetch("https://localhost:44336/employee/all").then(res => res.json()).then(
      result =>{
        console.log(result);
        this.setState({
          employees:result
        });
      }
    );
  }
  render(){
    return (
      <div>
        <h2>Employees Data...</h2>
        <table>
          <thead>
            <tr>
              <th>Id</th>
              <th>Name</th>
              <th>Location</th>
              <th>Salary</th>
            </tr>
          </thead>
          <tbody>      
          {this.state.employees.map(emp => (
            <tr key={emp.Name}>
              <td>{emp.Id}</td>
              <td>{emp.Name}</td>
              <td>{emp.Location}</td>
              <td>{emp.Salary}</td>
            </tr>
          ))
          } 
          </tbody>
        </table>
      </div>
    );
  }
}

const element=<EmployeeComponent></EmployeeComponent>

ReactDOM.render(element,document.getElementById("root"));
